-- SQL Query to insert an admin user
-- Note: Replace the password hash with a bcrypt hash of your desired password
-- You can generate a bcrypt hash using online tools or Node.js bcrypt library

INSERT INTO users (
    username,
    email,
    password,
    role,
    nama_lengkap,
    kelas
) VALUES (
    'admin',
    'admin@elearning-sma.com',
    '$2b$10$92IXUNpkjO0rOQ5byMi.Ye4oKoEa3Ro9llC/.og/at2.uheWG/igi', -- bcrypt hash for 'password123'
    'admin',
    'Administrator',
    NULL
);

